import ParticlesComponent from "./components/particles";
import "./App.css";

function App() {
  return (
    <div className="App">
      <ParticlesComponent id="particles" />
      <div className="Container">
        <h2 id="name"></h2>
      </div>
    </div>
  );
}

export default App;
